//functions
function setupMidiIn(device, inputs) {
  var arr = inputs.filter(function(input) {
    return (input.indexOf(device) === 0);
  });
  if (arr.length > 0) {
    return new easymidi.Input(arr[0]);
  } else {
    console.log('no midi input with device name: ' + device);
  }
}

function setupMidiOut(device, outputs) {
  var arr = outputs.filter(function(output) {
    return (output.indexOf(device) === 0);
  });
  if (arr.length > 0) {
    return new easymidi.Output(arr[0]);
  } else {
    console.log('no midi output with device name: ' + device);
  }
}

function makeMidiOutput(outputs) {
  var arr = outputs.filter(function(output) {
    return (output.indexOf('Launchpad') !== 0);
  });
  if (arr.length > 0) {
    console.log('midi output to device: ' + arr[arr.length - 1]);
    return new easymidi.Output(arr[arr.length - 1]);
  } else {
    console.log('no non launchpad midi devices connected');
  }
}

function handleNoteIn(note, velocity, seq) {
  if (velocity === 127) {
    if (trackPads.indexOf(note) !== -1) {//track change buttons
      seq.displayTrack = trackPads.indexOf(note);
      updateDisplay(seq);
      return;
    }
    if (pads.indexOf(note) !== -1) {//buttons in grid
      switch (seq.mode) {
        case 'step':
          var pad = pads.indexOf(note);
          var arr = displayArr(seq);
          var trackStep = arr[pad];
          trackStep = trackStep.split('|');
          var track = trackStep[0];
          var step = trackStep[1];
          seq.tracks[track][step] = !seq.tracks[track][step];
          break;
        case 'bpm':
          var pad = pads.indexOf(note);
          for (var i = 0; i < 4; i++) {
            var arr = verticalBar(i);
            var index = arr.indexOf(pad);
            if (index !== -1 && index < 10) {
              var speed = seq.bpm.split('');
              speed[i] = index;
              speed = speed.join('');
              if (+speed !== 0) {
                seq.bpm = speed;
              }
            }
          }
          break;
        case 'midi':
          var pad = pads.indexOf(note);
          var note = midiOutNotes[seq.displayTrack][1];
          note = note.split('');
          if (pad === 59) {
            note[0] = note[0] === '0' ? '1' : '0';
          }
          for (var i = 0; i < 4; i++) {
            if (i !== 1) {
              var arr = verticalBar(i);
              var index = arr.indexOf(pad);
            }
            if (i === 0 && index !== -1) {
              midiOutNotes[seq.displayTrack][0] = index;
            } else if (i > 1 && index !== -1 && index < 10) {
              note[i - 1] = index;
            }
          }
          note = note.join('');
          if (+note <= 127) {
            midiOutNotes[seq.displayTrack][1] = note;
          }
          break;
        case 'presetLoad':
          var pad = pads.indexOf(note);
          var preset = presets[pad];
          seq.tracks = preset.slice(0, 8);
          seq.lastStep = preset[8];
          break;
        case 'presetSave':
          var pad = pads.indexOf(note);
          var preset = [];
          for (var i = 0; i < seq.tracks.length; i++) {
            preset.push(seq.tracks[i]);
          }
          preset.push(seq.lastStep);
          presets[pad] = preset;
          if (!seq.presetWriting) {
            seq.presetWriting = true;
            fs.writeFile(__dirname + '/presets.json', JSON.stringify(presets), function(err) {
              if (err) {
                console.log(err);
                return;
              }
              console.log('preset saved');
              seq.presetWriting = false;
            });
          } else {
            console.log('already writing to preset file');
          }
          break;
        case 'lastStep':
          seq.lastStep[seq.displayTrack] = pads.indexOf(note);
          break;
      }
    }
  updateDisplay(seq);
  }
}

function handleCcIn(cc, value, seq) {
  if (value === 127) {
    switch (cc) {
      case controlPads[0]://reset
        seq.curStep = [-1, -1, -1, -1, -1, -1, -1, -1];
        break;
      case controlPads[1]://number of tracks viewed
        if (seq.tracksDisplayed > 7) {
          seq.tracksDisplayed = 1;
        } else {
          seq.tracksDisplayed = seq.tracksDisplayed * 2;
        }
        seq.scrollPage = 0;
        break;
      case controlPads[2]://scroll left
        seq.scrollPage--;
        seq.scrollPage = seq.scrollPage < 0 ? seq.tracksDisplayed - 1 : seq.scrollPage;
        break;
      case controlPads[3]://scroll right
        seq.scrollPage++;
        seq.scrollPage = seq.scrollPage >= seq.tracksDisplayed ? 0 : seq.scrollPage;
        break;
      case controlPads[4]://start stop
        if (seq.clockSource === 'internal') {
          if (!seq.running) {
            var speed = 60000 / ((+seq.bpm / 10) * 4);
            speed += 'm';
            seq.running = true;
            if (!seq.timerRunning) {
              timer.setInterval(advanceSeq, '', speed);
              seq.timerRunning = true;
            }
          } else {
            if (seq.timerRunning) {
              timer.clearInterval();
              seq.timerRunning = false;
            }
            seq.running = false;
          }
        } else {
          seq.running = !seq.running;
        }
        break;
      case controlPads[5]://bpm tapped and midi setup if held
        if (seq.mode === 'bpm' || seq.mode === 'midi') {
          if (seq.mode === 'midi') {
            fs.writeFile(__dirname + '/midiConfig.json', JSON.stringify(midiOutNotes), function(err) {
              if (err) {
                console.log(err);
                return;
              }
            });
          }
          seq.mode = 'step';
        } else {
          seq.mode = 'bpm';
        }
        seq.settingsHeld = Date.now();
        break;
      case controlPads[6]://last step
        seq.mode = seq.mode !== 'lastStep' ? 'lastStep' : 'step';
        break;
      case controlPads[7]://presets load tapped and save held
        if (seq.mode === 'presetLoad' || seq.mode === 'presetSave') {
          seq.mode = 'step';
        } else {
          seq.mode = 'presetLoad';
        }
        seq.presetsHeld = Date.now();
        break;
    }
  } else if (value === 0) {
    if (cc === controlPads[5] && seq.settingsHeld !== 0) {
      if (Date.now() > seq.settingsHeld + 1000) {//midi setup held 1 second
        seq.mode = 'midi';
      }
      seq.settingsHeld = 0;
    } else if (cc === controlPads[7] && seq.presetsHeld !== 0) {
      if (Date.now() > seq.presetsHeld + 1000) {
        seq.mode = 'presetSave';
      }
      seq.presetsHeld = 0;
    }
  }
  updateDisplay(seq);
}

function advanceSeq() {
  if (seq.running) {
    clockOut.write(0, function(err) {
      if (err) {
        console.log(err);
      }
    });
    timer.setTimeout(function() {
      clockOut.write(1, function(err) {
        if (err) {
          console.log(err);
        }
      });
    }, '', '5m');
    seq.toggle = !seq.toggle;
    for (var i = 0; i < 8; i++) {
      seq.curStep[i]++;
      if (seq.curStep[i] > seq.lastStep[i]) {
        seq.curStep[i] = 0;
      }
      if (seq.tracks[i][seq.curStep[i]]) {
        triggerOut(i);
      }
    }
  }
  updateDisplay(seq);
}

function triggerOut(track) {
  //analog triggers
  triggerGPIO[track].write(0, function(err) {
    if (err) {
      console.log(err);
    }
  });
  timer.setTimeout(function() {
    triggerGPIO[track].write(1, function(err) {
      if (err) {
        console.log(err);
      }
    });
  }, '', '5m');
  //midi
  if (midiOut !== undefined) {
    midiOut.send('noteon', {
      note: +midiOutNotes[track][1],
      velocity: 127,
      channel: midiOutNotes[track][0]
    });
  }
}

function changePad(pad, color) {//could change to take channel as argument
  output.send('noteon', {
    note: pad,
    velocity: color,
    channel: channel
  });
}

function changeControl(pad, color) {
  output.send('cc', {
    controller: pad,
    value: color,
    channel: channel
  });
}

function updateDisplay(seq) {
  switch (seq.mode) {
    case 'step':
      var arr = displayArr(seq);
      for (var i = 0; i < 64; i++) {
        var step = arr[i];
        step = step.split('|');
        var track = +step[0];
        var stepNum = +step[1];
        var selected = seq.tracks[track][stepNum];
        var color;
        var dimColor = dark;
        if (seq.tracksDisplayed === 1) {
          changeControl(controlPads[2], dark);
          changeControl(controlPads[3], dark);
        } else {
          dimColor = trackColors[track][0];
          if (seq.scrollPage === 0) {
            changeControl(controlPads[2], dark);
            changeControl(controlPads[3], trackColors[0][1]);
          } else if (seq.scrollPage === seq.tracksDisplayed - 1){
            changeControl(controlPads[2], trackColors[seq.scrollPage][1]);
            changeControl(controlPads[3], dark);
          } else {
            changeControl(controlPads[2], trackColors[seq.scrollPage][1]);
            changeControl(controlPads[3], trackColors[seq.scrollPage][1]);
          }
        }
        if (stepNum === seq.curStep[track]) {
          color = selected ? brightRunner : darkRunner;
        } else {
          color = selected ? trackColors[track][1] : dimColor;
        }
        changePad(pads[i], color);
      }
      changeControl(controlPads[5], dark);
      changeControl(controlPads[6], dark);
      changeControl(controlPads[7], dark);
      break;
    case 'bpm':
      var speed = seq.bpm.split('');
      for (var i = 0; i < 4; i++) {
        digitFader(i, +speed[i]);
      }
      changeControl(controlPads[5], brightRunner);
      changeControl(controlPads[6], dark);
      changeControl(controlPads[7], dark);
      break;
    case 'midi':
      var note = midiOutNotes[seq.displayTrack][1];
      note = note.split('');
      for (var i = 0; i < 2; i++) {
        var color = dark;
        var arr = verticalBar(i);
        for (var j = 0; j < 16; j++) {
          if (i === 0) {
            color = brightRunner;
            if (j === midiOutNotes[seq.displayTrack][0]) {
              color = trackColors[i][1];
            }
          } else {
            var hundredsColor = darkRunner;
            if (note[0] === '1') {
              hundredsColor = trackColors[1][1];
            }
            changePad(pads[59], hundredsColor);
          }
          changePad(pads[arr[j]], color);
        }
      }
      digitFader(2, +note[1]);
      digitFader(3, +note[2]);
      changeControl(controlPads[5], brightRunner);
      changeControl(controlPads[6], dark);
      changeControl(controlPads[7], dark);
      break;
    case 'presetLoad':
      for (var i = 0; i < 64; i++) {
        var color = loadDisplay[i] ? brightRunner : dark;
        changePad(pads[i], color);
      }
      changeControl(controlPads[5], dark);
      changeControl(controlPads[6], dark);
      changeControl(controlPads[7], brightRunner);
      break;
    case 'presetSave':
      for (var i = 0; i < 64; i++) {
        var color = saveDisplay[i] ? brightRunner : dark;
        changePad(pads[i], color);
      }
      changeControl(controlPads[5], dark);
      changeControl(controlPads[6], dark);
      changeControl(controlPads[7], darkRunner);
      break;
    case 'lastStep':
      for (var i = 0; i < 64; i++) {
        var color = trackColors[seq.displayTrack][1];
        if (i === seq.curStep[seq.displayTrack]) {
          color = brightRunner;
        } else if (i > seq.lastStep[seq.displayTrack]) {
          color = trackColors[seq.displayTrack][0];
        }
        changePad(pads[i], color);
      }
      changeControl(controlPads[5], dark);
      changeControl(controlPads[6], brightRunner);
      changeControl(controlPads[7], dark);
      break;
  }
  //tracks
  for (var j = 0; j < 8; j++) {
    var trackColor = trackColors[j][0];
    if (j === seq.displayTrack) {
      trackColor = trackColors[j][1];
    }
  changePad(trackPads[j], trackColor);
  }
  //toggle flash
  if (seq.toggle || !seq.running) {
    changeControl(controlPads[4], brightRunner);
  } else {
    changeControl(controlPads[4], dark);
  }
}

function verticalBar(row) {
  var base = row * 2;
  return [base + 56, base + 48, base + 40, base + 32, base + 24, base + 16, base + 8, base, base + 57, base + 49, base + 41, base + 33, base + 25, base + 17, base + 9, base + 1];
}

function digitFader(row, num) {
  var arr = verticalBar(row);
  for (var i = 0; i < 16; i++) {
    var color = darkRunner;
    if (i === 0) {
      color = brightRunner;
    } else if (num + 1 > i) {
      color = trackColors[row][1];
    } else if (i > 9) {
      color = dark;
    }
    changePad(pads[arr[i]], color);
  }
}

function displayArr(seq) {
  var track = seq.displayTrack;
  var page = seq.scrollPage;
  var arr = [];
  switch(seq.tracksDisplayed) {
    case 1:
      for (var i = 0; i < 64; i++) {
        arr.push(track + '|' + i);
      }
      break;
    case 2:
      var track1 = track < 7 ? track : 6;
      var track2 = track1 + 1;
      for (var i = 0; i < 64; i++) {
        var item = '';
        if (i < 32) {
          item = track1 + '|' + (i + (page * 32));
        } else {
          item = track2 + '|' + (i - 32 + (page * 32));
        }
        arr.push(item);
      }
      break;
    case 4:
      var tracck1;
      if (track < 4) {
        track1 = track;
      } else {
        track1 = 4;
      }
      var track2 = track1 + 1;
      var track3 = track1 + 2;
      var track4 = track1 + 3;
      for (var i = 0; i < 64; i++) {
        var item = '';
        if (i < 16) {
          item = track1 + '|' + (i + (page * 16));
        } else if (i < 32) {
          item = track2 + '|' + (i - 16 + (page * 16));
        } else if (i < 48) {
          item = track3 + '|' + (i - 32 + (page * 16));
        } else {
          item = track4 + '|' + (i - 48 + (page * 16));
        }
        arr.push(item);
      }
      break;
    case 8:
      for (var i = 0; i < 64; i++) {
        var item = '';
        if (i < 8) {
          item = '0|' + (i + (page * 8));
        } else if (i < 16) {
          item = '1|' + (i - 8 + (page * 8));
        } else if (i < 24) {
          item = '2|' + (i - 16 + (page * 8));
        } else if (i < 32) {
          item = '3|' + (i - 24 + (page * 8));
        } else if (i < 40) {
          item = '4|' + (i - 32 + (page * 8));
        } else if (i < 48) {
          item = '5|' + (i - 40 + (page * 8));
        } else if (i < 56) {
          item = '6|' + (i - 48 + (page * 8));
        } else {
          item = '7|' + (i - 56 + (page * 8));
        }
        arr.push(item);
      }
      break;
  }
  return arr;
}

function handleClockSwitch(err, value) {
  if (err) {
    console.log(err);
  }
  seq.clockSource = value === 0 ? 'external' : 'internal';
  if (seq.clockSource === 'external') {
    if (seq.timerRunning) {
      timer.clearInterval();
      seq.timerRunning = false;
    }
    if (!seq.clockWathced) {
      clockIn.watch(handleClockIn);
      seq.clockWathced = true;
    }
  } else {
    if (seq.clockWathced) {
      clockIn.unwatch();
      seq.clockWathced = false;
    }
    if (seq.running && !seq.timerRunning) {
      var speed = 60000 / ((+seq.bpm / 10) * 4);
      speed += 'm';
      timer.setInterval(advanceSeq, '', speed);
      seq.timerRunning = true;
    }
  }
}

function handleClockIn(err, value) {
  if (err) {
    console.log(err);
  }
  advanceSeq();
}

function handleResetIn(err, value) {
  if (err) {
    console.log(err);
  }
  seq.curStep = [-1, -1, -1, -1, -1, -1, -1, -1];
  updateDisplay(seq);
}

function shutdown() {
  powerSwitch.unwatch();
  fs.writeFile(__dirname + '/midiConfig.json', JSON.stringify(midiOutNotes), function(err) {
    if (err) {
      console.log(err);
    }
    console.log('midi settings saved');
    fs.writeFile(__dirname + '/presets.json', JSON.stringify(presets), function(err) {
      if (err) {
        console.log(err);
      }
      console.log('presets saved');
      console.log('shutting down system');
      exec('/sbin/shutdown -h now', function(error, stdout, stderr) {
        console.log('stdout: ' + stdout);
        console.log('stderr: ' + stderr);
        if (error !== null) {
          console.log('exec error: ' + error);
        }
      });
    });
  });
}
